import axios from 'axios';
import React, {useState} from 'react'
import { Link, useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';

import loader from '../asset/Spinner-1s-64px.svg';

export const Register = () => {
  let navigate = useNavigate();

  const [errorMessages, setErrorMessages] = useState({});
  const [isLoading, setIsLoading] = useState(false);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [passwordAgain, setPasswordAgain] = useState('');
  const [address, setAddress] = useState('');
  const [phone, setPhone] = useState('');


  const renderErrorMessage = (name) =>
  name === errorMessages.name && (
    <div className="error">{errorMessages.message}</div>
  );

  const handleSubmit = (e) => {
    e.preventDefault();

    const user = {
      email,
      name,
      password,
      address,
      phone
    }

    console.log("user: " + JSON.stringify(user));

    setIsLoading(true);
    if(password !== passwordAgain){
      setIsLoading(false);
      toast.error('Nhập lại mật khẩu không đúng', {
        position: "top-right",
        autoClose: 3000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
        theme: "light",
      });
    }else{

      var raw = JSON.stringify({
        "name": `${name}`,
        "email": `${email}`,
        "password": `${password}`,
        "address": `${address}`,
        "phone": `${phone}`
      });

      var config = {
        method: 'post',
        url: 'http://localhost:8080/Client/api-register',
        headers: { 
          'Accept-Charset': 'UTF-8', 
          'Content-Type': 'application/json'
        },
        data : raw
      };

      axios(config)
        .then(res => {
              console.log("dk: " + res)
              //navigate("/dang-nhap");
              setIsLoading(false);
              toast.success('Đăng ký thành công!', {
                position: "top-right",
                autoClose: 3000,
                hideProgressBar: false,
                closeOnClick: true,
                pauseOnHover: true,
                draggable: true,
                progress: undefined,
                theme: "light",
              })
        })
        .catch(err => {
          setIsLoading(false);
          toast.error(err.message, {
            position: "top-right",
            autoClose: 3000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
            theme: "light",
          })
        });
    }

  }

  return (
    <div className="form-wrapper">
        <div className="form">
          <form onSubmit={handleSubmit}>
            <div className="input-container">
              <label>Họ tên: </label>
              <input type="text" name="name" value={name} onChange={e => setName(e.target.value)} />
              {renderErrorMessage("name")}
            </div>
            <div className="input-container">
              <label>Email: </label>
              <input type="email" name="email" value={email} onChange={e => setEmail(e.target.value)} />
              {renderErrorMessage("email")}
            </div>
            <div className="input-container">
              <label>Mật khẩu: </label>
              <input type="password" name="password" value={password} onChange={e => setPassword(e.target.value)} />
              {renderErrorMessage("password")}
            </div>
            <div className="input-container">
              <label>Nhập lại mật khẩu: </label>
              <input type="password" name="passwordAgain" value={passwordAgain} onChange={e => setPasswordAgain(e.target.value)} />
              {renderErrorMessage("passwordAgain")}
            </div>
            <div className="input-container">
              <label>Địa chỉ: </label>
              <input type="text" name="address" value={address} onChange={e => setAddress(e.target.value)} />
              {renderErrorMessage("address")}
            </div>
            <div className="input-container">
              <label>Số điện thoại: </label>
              <input type="text" name="phone" value={phone} onChange={e => setPhone(e.target.value)} />
              {renderErrorMessage("phone")}
            </div>
            <div className="button-container">
              <button type="submit" > { isLoading && <img src={loader} alt="loader" />} Đăng ký</button>
            </div>
            <span>Đã có tài khoản. <Link to="/dang-nhap">Đăng nhập ngay!</Link></span>
          </form>
        </div>
    </div>
  )
}
